import {useState, useEffect} from "react";

function UserList(props) {
  const [userList, setUserList] = useState(props.userList);

  return (
    <div>
      <div>User List:</div>
      <table>
        <thead>
          <tr>
            <th>ID</th>
            <th>Name</th>
            <th>Year</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>2</td>
            <td>3</td>
            <td>4</td>
          </tr>
        </tbody>
      </table>
    </div>
  );
}

export default UserList;
